--Global API

function LoreBooks_GetNewEideticDataFromBookId(bookId)
	if not bookData[bookId] then
		bookData[bookId] = {k = bookId}
	end
	return bookData[bookId]
end

function LoreBooks_GetNewEideticData(categoryIndex, collectionIndex, bookIndex)
	local _, _, _, bookId = GetLoreBookInfo(categoryIndex, collectionIndex, bookIndex)
	return LoreBooks_GetNewEideticDataFromBookId(bookId)
end

function LoreBooks_GetNewEideticDataFor(index, column)
	
	local categoryName, numCollections = GetLoreCategoryInfo(3) -- Only Eidetic
	local eideticInZone = {}
	for collectionIndex = 1, numCollections do
		local _, _, _, totalBooks = GetLoreCollectionInfo(3, collectionIndex)
		for bookIndex = 1, totalBooks do
			local eideticData = LoreBooks_GetNewEideticData(3, collectionIndex, bookIndex)
			if eideticData and eideticData.e and not eideticData.r and (column == "z" or (column == "m" and (not eideticData.qm or eideticData.qm == index))) then
				for _, bookData in ipairs(eideticData.e) do
					if bookData[column] == index then
						bookData.c = collectionIndex -- Add collectionIndex
						bookData.b = bookIndex -- Add bookIndex
						bookData.q = eideticData.q -- Add quest info
						bookData.qm = eideticData.qm -- Add quest map info
						bookData.qt = eideticData.qt -- Add quest type info
						table.insert(eideticInZone, bookData)
					end
				end
			end
		end
	end
	
	return eideticInZone
	
end

function LoreBooks_GetNewEideticDataForZone(zoneIndex)
	return LoreBooks_GetNewEideticDataFor(zoneIndex, "z")
end

function LoreBooks_GetNewEideticDataForMap(mapIndex)
	return LoreBooks_GetNewEideticDataFor(mapIndex, "m")
end

local function GetNumKnownBooksInCollection(categoryIndex, collectionIndex, booksInCollection)
	
	local numKnownBooks = 0
	if categoryIndex and collectionIndex and booksInCollection then
		for bookIndex=1, booksInCollection do
			 local known = select(3, GetLoreBookInfo(categoryIndex, collectionIndex, bookIndex))
			 if known then
				numKnownBooks = numKnownBooks + 1
			 end
		end
	end
	
	return numKnownBooks
	
end

local function GetMissingEideticBooks()

	local categoryIndex = 3
	local _, numCollections = GetLoreCategoryInfo(categoryIndex)
	
	for collectionIndex = 1, numCollections do
		
		local collectionName, _, _, totalBooks, hidden = GetLoreCollectionInfo(categoryIndex, collectionIndex)
		
		if not hidden then
			
			for bookIndex = 1, totalBooks do
				
				local bookName, _, _, bookId = GetLoreBookInfo(categoryIndex, collectionIndex, bookIndex)
				
				if not bookData[bookId].c then
					d("Book [" .. bookName .. "] (#" .. bookId .. ") is still Unknown. Collection " .. collectionName .. " (3/" .. collectionIndex .. ")")
				end
				
			end
		end
	end

end

SLASH_COMMANDS["/lunk"] = GetMissingEideticBooks

function LoreBooks_GetNewLoreCollectionInfo(categoryIndex, collectionIndex)
	if libraryData[categoryIndex] and libraryData[categoryIndex][collectionIndex] then
		return libraryData[categoryIndex][collectionIndex].n[GetCVar("Language.2")], libraryData[categoryIndex][collectionIndex].d[GetCVar("Language.2")], GetNumKnownBooksInCollection(categoryIndex, collectionIndex, libraryData[categoryIndex][collectionIndex].t), libraryData[categoryIndex][collectionIndex].t, libraryData[categoryIndex][collectionIndex].h, libraryData[categoryIndex][collectionIndex].g, libraryData[categoryIndex][collectionIndex].k
	end
end